import './App.css';
import {BrowserRouter as Router, Route, Routes} from "react-router-dom"
import VehicleLogs from './pages/VehicleLogs';

function App() {
  return (
    <Router>
        <Routes>
          <Route exact path='/' element={<VehicleLogs/>} />
        </Routes>
    </Router>
  );
}

export default App;
